import Topnav from './Topnav';
import { Container } from 'semantic-ui-react';
import { toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
toast.configure()

const Layout = ({ children }) => {
    return (
        <React.Fragment>
            <Topnav />
            <Container>
                { children }
            </Container>
        </React.Fragment>
    )
}

export default Layout;
